        (rem, ans, binom) = (m * k, 0, 0)
        ones = 0
        while ones <= k:
            take = min(1 if ones == 0 else rem // ones, binom)
            if take == 0:
                break
            ans += take
            rem -= ones * take
            binom = binom * (k - ones) // (ones + 1)
            ones += 1
        return ans
    ans = 1
    while go(m, ans) < n:
        ans *= 2
    jmp = ans
    while jmp:
        if go(m, ans - jmp) >= n:
            ans -= jmp
        jmp //= 2
    return ans

